B.KI=new A.zj("CORE VALUES","We call them SCAITS. We demonstrate these values in everything we do. They are ingrained into everyone who is partof our business. They are what make us the go-to solution whenAustralians want dependable products adn reliable service.","SERVICE","We understand that when a client is successful, we are successful. We value our clients\u2019 business, trust, and feedback, and strive to provide them with the best products and service. We want them to know we care.","COMMITMENT","We believe that in order to have action, you first need commitment. Commitment itself has two components: a sound set of beliefs and faithful adherence to those beliefs. We believe that commitment \u201cignites\u201d action and in \u201cpersistence with a purpose\u201d.","ACCOUNTABILITY","We are happy to be judged by what we do \u2013 as opposed to what we say we will do \u2013 because, very simply, we do what we say we will do. This is a value we demand not only in our relationship and interactions with clients but in ourselves as well. Being accountable allows us to develop positive life skills, make better decisions, and be better people.","INTEGRITY","Trust is earned. By working safely, professionally, and ethically \u2013 regardless of the cost or difficulty involved \u2013 we have earned the trust of Western Australia to become its biggest independent air compressor provider. We take that trust seriously; even if we\u2019ve already earned it, we confirm it.","TECHNOLOGY","Quality, innovation, evolution. These are the foundations for more than just success. They are the backbone of competitive advantage. We embrace technology because it allows us to bring the very best products to you and to maintain those products over the long.","SOCIAL RESPONSIBILITY","We believe that our quality of life is improved by providing committed service and expertise to our clients, and by contributing to local communities and society as a whole. We lead by example to make our community and industry stronger.",null)
